标准输出也叫控制台输出，Rust 里面常见的标准输出宏有 print! 和 println!。它们的区别是后者比前者在末尾多输出一个换行符。 例子1： fn main() { print!("this "); print!("will "); print!("be "); print!("on "); print!("the "); print!("same "); print!("line "); print!("this string has a newline, why not choose println! instead?
");} 例子2： fn main() { println!("hello there!"); println!("format {} arguments", "some");} 这里两个例子都比较简单。读者可以运行一下查看输出结果对比一下他们的区别。 值得注意的是例子 2 中，{ } 会被 "some" 所替换。这是 rust 里面的一种格式化输出。 标准化的输出是行缓冲(line-buffered)的,这就导致标准化的输出在遇到一个新行之前并不会被隐式刷新。 换句话说 print! 和 println! 二者的效果并不总是相同的。 如果说得更简单明了一点就是，您不能把 print! 当做是C语言中的 printf 譬如： use std::io;fn main() { print!("请输入一个字符串："); let mut input = String::new(); io::stdin() .read_line(&mut input) .expect("读取失败"); print!("您输入的字符串是：{}
", input);} 在这段代码运行时则不会先出现预期的提示字符串，因为行没有被刷新。 如果想要达到预期的效果就要显示的刷新： use std::io::{self, Write};fn main() { print!("请输入一个字符串："); io::stdout().flush().unwrap(); let mut input = String::new(); io::stdin() .read_line(&mut input) .expect("读取失败"); print!("您输入的字符串是：{}
", input);}
